import Figure from 'react-bootstrap/Figure';
import '../css/Figura.css'
import gambar from'../../src/the_people_logo_2_top.png'

function MyFigure() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        width={300}
        height={400}
        alt="171x180"
        src={gambar}
        style={{ width: "100%", maxWidth: "200px", display: "block" }}
      />
      <Figure.Caption>
        Nulla vitae elit libero, a pharetra augue mollis interdum.
      </Figure.Caption>
    </Figure>
  );
}

export default MyFigure;
